import * as S from "./styles"

interface Props {
  open?: boolean
}

export const Modal = ({ open }: Props) => {
  return (
    <S.Container>
      <S.Body>
        <S.Title>Eu sou uma caxinha</S.Title>
      </S.Body>
    </S.Container>
  )
}
